import React, { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import "./styles.scss";
import * as actions from "./../../../Actions";
import User from "./User";

const Index = () => {
  const [usersAdmim, setUsersAdmin] = useState([]);
  const [usersCustomer, setUsersCustomer] = useState([]);

  const dispatch = useDispatch();
  const getUsersAdmin = () => dispatch(actions.acGetUserAdminRequest());
  const getUsersCustomer = () => dispatch(actions.acGetUsersRequest());

  useEffect(() => {
    getUsersAdmin();
    getUsersCustomer();
    setUsersAdmin(useSelector((state) => state.usersAdmin));
    setUsersCustomer(useSelector((state) => state.users));
  }, []);

  return (
    <div className="container-fluid mt-5" id="manager-users">
      <div className="container">
        <div className="row">
          <div className="col-12 text-center">
            <h3 className="font-ubun">Manager Users</h3>
          </div>
          <div className="col-12">
            <table className="table">
              <thead>
                <tr>
                  <th>STT</th>
                  <th>Account</th>
                  <th>Password</th>
                  <th>Status</th>
                  <th>Role</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody></tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Index;
